import { FETCH_PHOTO } from './types';

export const fetchPhoto = () => dispatch => {
  fetch("https://api.unsplash.com/collections/4578671/photos/?orientation=landscape&per_page=100&client_id=" + "B5vLJ0aNYeNZOYtpiNcNNfN0CdpoQgpgtmWnvj3YgJc")
  //fetch("https://jsonplaceholder.typicode.com/todos")
  .then(res => res.json())
  .then(
    (result) => {
      var random_num = Math.floor(Math.random() * result.length);
      var photo = result[random_num].urls.regular
      dispatch({
      type: FETCH_PHOTO,
      payload: photo
    });
  })
}
